import ColorLogo from "./logo_color.png";
import ColorLogoB from "./logo_color1.png";
import EmailSent from "./emailSent.png";
import Food from "./food.png";
import FoodWhite from "./food_white.png";
import SplashScreen from "./splashscreen.png";
import AvatarUser from "./avatar.jpg";
import Photo2 from "./photo2.jpg";

let png = {};

png = {
  ColorLogo,
  ColorLogoB,
  EmailSent,
  FoodWhite,
  AvatarUser,
  Food,
  SplashScreen,
  Photo2,
};

export default png;
